import React from 'react';


const SongArtist = ({data}) => {


    return ( 
        <div className='song-artist'>
            <h2>{data.name && data.name}</h2>
            {data.images && <img src={data.images[0].url} alt="img"/>}
            <br/><br/><br/>

            <div>
                <div className='genres'>
            {data.genres && data.genres.map((el, index)=> <span key={index}># {el.charAt(0).toUpperCase() + el.slice(1)}</span>)}
                </div>
            <br/>
            {data.followers && (
                <div style={{display:"flex", alignItems:"center", gap:"10px"}}>
                    <span>{data.followers.total}</span>
                    <span>Followers</span>
                </div>
            )}
            </div>

            <br/>
            {data.external_urls && <a href={data.external_urls.spotify} target="_blank" rel="noopener noreferrer">Listen on Spotify</a>}

        </div>
     );
    }

    export default SongArtist;



